import React, { useEffect } from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './App.css';

const base = 'https://cloud.iexapis.com/stable';
const ext = '/stock/twtr/chart/1m';

const token = '?token=pk_0b61d9bd2072480cb885c51c1a47f59d';

const App = () => {
  useEffect(() => {
    const get = async () => {
      const resp = await axios.get(`${base}${ext}${token}`);
      console.log(resp);
    }

    get();
  }, []);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
